import React from "react";
import PropTypes from "prop-types";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBookmark, faCoffee } from "@fortawesome/free-solid-svg-icons";

export default function CardStats({
}:{
    statSubtitle: any
    statTitle:any
    statArrow:any
    statPercent:any
    statPercentColor:any
    statIconName:any
    statDescripiron:any
    statIconColor: any
}) {
  return (
    <>
      <div className="relative flex flex-col min-w-0 break-words bg-white rounded mb-6 xl:mb-0 shadow-lg">
        <div className="flex-auto p-4">
          <div className="flex flex-wrap">
            <div className="relative w-full pr-4 max-w-full flex-grow flex-1">
              <h5 className="text-gray-500 uppercase font-bold text-xs">
                <span>Test</span>
              </h5>
              <span className="font-semibold text-xl text-gray-800">
                <span>Test 1</span>
              </span>
            </div>
            <div className="relative w-auto pl-4 flex-initial">
              <div
                className={
                  "text-white p-3 text-center inline-flex items-center justify-center w-12 h-12 shadow-lg rounded-full bg-red-500 " 
                }
              >
                 <FontAwesomeIcon icon={faBookmark} className="ml-2" transform="grow-7"/>
              </div>
            </div>
          </div>
          <p className="text-sm text-gray-500 mt-4">

          </p>
        </div>
      </div>
    </>
  );
}

CardStats.propTypes = {
  statSubtitle: PropTypes.string,
  statTitle: PropTypes.string,
  statArrow: PropTypes.oneOf(["up", "down"]),
  statPercent: PropTypes.string,
  // can be any of the text color utilities
  // from tailwindcss
  statPercentColor: PropTypes.string,
  statDescripiron: PropTypes.string,
  statIconName: PropTypes.string,
  // can be any of the background color utilities
  // from tailwindcss
  statIconColor: PropTypes.string,
};
